import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  header: {
    flex: 1,
    paddingTop: 60,
    backgroundColor: "#53C896",
  },
  item: {
    borderStyle: "solid",
    borderColor: "black",
    borderWidth: 1,
    width: "90%",
    minHeight: "40%",
    marginTop: 5,
  },
});

export default styles;
